import React, {
  Component
} from 'react';

class MyBootStrap extends Component {

  render() {

    return ( < div class = 'MyBootStrap' >
      <
      div class = "jumbotron text-center" >
      <
      h1 > My First Bootstrap Page < /h1> <
      p > Resize this responsive page to see the effect! < /p> < /
      div >

      <
      div class = "container-fluid" >
      <
      div class = "row" >
      <
      div class = "col-sm-3"
      style = {
        {
          background: 'red'
        }
      } >
      <
      h3 > Column 1 < /h3> <
      p > Lorem ipsum dolor.. < /p> <
      p > Ut enim ad.. < /p> < /
      div > <
      div class = "col-md-3 display-4"
      style = {
        {
          background: 'green'
        }
      } >
      <
      h3 > Column 2 < /h3> <
      p > Lorem ipsum dolor.. < /p> <
      p > < abbr > Ut enim ad.. < /abbr> < /p > < /
      div > <
      div class = "col-lg-3"
      style = {
        {
          background: 'blue'
        }
      } >
      <
      h3 > Column 3 < /h3> <mark><
      p > Lorem ipsum dolor.. < /p></mark > <
      p > Ut enim ad.. < /p> < /
      div >
      <
      div class = "col-xl-3 "
      style = {
        {
          background: 'purple'
        }
      } >
      <
      h3 > Column 4 < /h3> <
      p > Lorem ipsum dolor.. < /p> <small><
      p > Ut enim ad.. < /p></small > < /
      div > <
      /div> < /
      div > < /
      div >
    );
  }
}
export default MyBootStrap;
